  return (
    <div>
      <>
        <BrowserRouter>
          <NavBar />
          <Routes>
            <Route path="/" element={<ItemListContainer />} />
            <Route
              path="/categoria/:idCategoria"
              element={<ItemListContainer />}
            />
            <Route path="/Item/:idItem" element={<ItemDetailConteiner />} />
            <Route path="*" element={<h2> Sitio en construcci√≥n </h2>} />
          </Routes>
        </BrowserRouter>
      </>
    </div>
  );
}

export default App;
